        method: 'GET',
        // body: JSON.stringify(data),
        headers: {
            'Accept': 'application/json',
            'Content-Type': 'application/json'
        }
    })
        .then(result => result.json())
        .then(response => {
            return response
        })
    XZ
};


export default deletingproductsAPI
